INSERT INTO `wp_posts` VALUES (1,1,'2022-12-14 15:10:32','2022-12-14 15:10:32','<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->','Hello world!','','publish','open','open','','hello-world','','','2022-12-14 15:10:32','2022-12-14 15:10:32','',0,'http://localhost:8888/oncorx/?p=1',0,'post','',1),(2,1,'2022-12-14 15:10:32','2022-12-14 15:10:32','<!-- wp:paragraph {\"className\":\"font-italic text-white h2 garamond bold\"} -->\n<p class=\"font-italic text-white h2 garamond bold\">Whether Patients, Oncologists Or Pharma,<br>OncoRx Insights Is Here To Get You Medical Data Faster</p>\n<!-- /wp:paragraph -->','YOUR MEDICAL DATA YOUR WAY','','publish','closed','open','','sample-page','','','2022-12-15 20:30:33','2022-12-15 20:30:33','',0,'http://localhost:8888/oncorx/?page_id=2',0,'page','',0),(3,1,'2022-12-14 15:10:32','2022-12-14 15:10:32','<!-- wp:heading --><h2>Who we are</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Our website address is: http://localhost:8888/oncorx.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Comments</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>When visitors leave comments on the site we collect the data shown in the comments form, and also the visitor&#8217;s IP address and browser user agent string to help spam detection.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>An anonymized string created from your email address (also called a hash) may be provided to the Gravatar service to see if you are using it. The Gravatar service privacy policy is available here: https://automattic.com/privacy/. After approval of your comment, your profile picture is visible to the public in the context of your comment.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Media</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you upload images to the website, you should avoid uploading images with embedded location data (EXIF GPS) included. Visitors to the website can download and extract any location data from images on the website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Cookies</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment on our site you may opt-in to saving your name, email address and website in cookies. These are for your convenience so that you do not have to fill in your details again when you leave another comment. These cookies will last for one year.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you visit our login page, we will set a temporary cookie to determine if your browser accepts cookies. This cookie contains no personal data and is discarded when you close your browser.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>When you log in, we will also set up several cookies to save your login information and your screen display choices. Login cookies last for two days, and screen options cookies last for a year. If you select &quot;Remember Me&quot;, your login will persist for two weeks. If you log out of your account, the login cookies will be removed.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>If you edit or publish an article, an additional cookie will be saved in your browser. This cookie includes no personal data and simply indicates the post ID of the article you just edited. It expires after 1 day.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Embedded content from other websites</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Articles on this site may include embedded content (e.g. videos, images, articles, etc.). Embedded content from other websites behaves in the exact same way as if the visitor has visited the other website.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>These websites may collect data about you, use cookies, embed additional third-party tracking, and monitor your interaction with that embedded content, including tracking your interaction with the embedded content if you have an account and are logged in to that website.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Who we share your data with</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you request a password reset, your IP address will be included in the reset email.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>How long we retain your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you leave a comment, the comment and its metadata are retained indefinitely. This is so we can recognize and approve any follow-up comments automatically instead of holding them in a moderation queue.</p><!-- /wp:paragraph --><!-- wp:paragraph --><p>For users that register on our website (if any), we also store the personal information they provide in their user profile. All users can see, edit, or delete their personal information at any time (except they cannot change their username). Website administrators can also see and edit that information.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>What rights you have over your data</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>If you have an account on this site, or have left comments, you can request to receive an exported file of the personal data we hold about you, including any data you have provided to us. You can also request that we erase any personal data we hold about you. This does not include any data we are obliged to keep for administrative, legal, or security purposes.</p><!-- /wp:paragraph --><!-- wp:heading --><h2>Where your data is sent</h2><!-- /wp:heading --><!-- wp:paragraph --><p><strong class=\"privacy-policy-tutorial\">Suggested text: </strong>Visitor comments may be checked through an automated spam detection service.</p><!-- /wp:paragraph -->','Privacy Policy','','draft','closed','open','','privacy-policy','','','2022-12-14 15:10:32','2022-12-14 15:10:32','',0,'http://localhost:8888/oncorx/?page_id=3',0,'page','',0),(4,1,'2022-12-14 15:10:45','0000-00-00 00:00:00','','Auto Draft','','auto-draft','open','open','','','','','2022-12-14 15:10:45','0000-00-00 00:00:00','',0,'http://localhost:8888/oncorx/?p=4',0,'post','',0),(7,1,'2022-12-14 15:22:24','2022-12-14 15:22:24','','favicon','','inherit','open','closed','','favicon','','','2022-12-14 15:22:30','2022-12-14 15:22:30','',0,'http://localhost:8888/oncorx/wp-content/uploads/2022/12/favicon.png',0,'attachment','image/png',0),(8,1,'2022-12-14 15:22:32','2022-12-14 15:22:32','http://localhost:8888/oncorx/wp-content/uploads/2022/12/cropped-favicon.png','cropped-favicon.png','','inherit','open','closed','','cropped-favicon-png','','','2022-12-14 15:22:32','2022-12-14 15:22:32','',0,'http://localhost:8888/oncorx/wp-content/uploads/2022/12/cropped-favicon.png',0,'attachment','image/png',0),(9,1,'2022-12-14 15:22:37','2022-12-14 15:22:37','{\n    \"blogdescription\": {\n        \"value\": \"YOUR MEDICAL DATA YOUR WAY\",\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-12-14 15:22:37\"\n    },\n    \"site_icon\": {\n        \"value\": 8,\n        \"type\": \"option\",\n        \"user_id\": 1,\n        \"date_modified_gmt\": \"2022-12-14 15:22:37\"\n    }\n}','','','trash','closed','closed','','e0897e45-9bb3-4904-9551-0cc34e551bc4','','','2022-12-14 15:22:37','2022-12-14 15:22:37','',0,'http://localhost:8888/oncorx/2022/12/14/e0897e45-9bb3-4904-9551-0cc34e551bc4/',0,'customize_changeset','',0),(10,1,'2022-12-14 15:23:02','2022-12-14 15:23:02','a:8:{s:8:\"location\";a:1:{i:0;a:1:{i:0;a:3:{s:5:\"param\";s:12:\"options_page\";